  \"2016-05-31T01:06:55.675347\",\n\t\"name\": \"afsc-nmml-ccep-food-habits-of-pinnipeds-at-san-miguel-island-california\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Marine Mammal Laboratories'
  California Current Ecosystem Program (AFSC/NOAA) collects fecal samples to examine
  the diet of pinnipeds, including California sea lions (Zalophus californianus),
  northern fur seals (Callorhinus ursinus), northern elephant seals (Mirounga angustirostris),
  and Pacific harbor seals (Phoca vitulina) on San Miguel Island, California. Data
  are used to examine temporal changes in diet by the populations, as well as to make
  intra- and inter-specific comparisons at San Miguel Island.\",\n\t\"license_title\":
